ement("dt",null,"What is the weather like in September in Orlando?"),u.default.createElement("dd",null,"Usually hot (80-90 during days) and often humid with occasional showers. However, conference room temperatures and personal comfort varies. Because meeting rooms tend to be cool, you may want to dress in layers and bring a sweater or jacket."),u.default.createElement("dt",null,"This is my first Leadership Conference, and I feel that I need some additional information about the conference. Who can I contact?"),u.default.createElement("dd",null,"Please see your District Manager to receive additional information about the Managers' Leadership Conference and to review the conference expectations."),u.default.createElement("dt",null,"When will I receive my Conference Information?"),u.default.createElement("dd",null,"Conference Information will be sent to your Store/Design & Service Center ",u.default.createElement("strong",null,"two weeks prior to your departure"),"."),u.default.createElement("dt",null,"Another Store/Design & Service Center Manager received his/her flight itinerary via their preferred email. I have not received mine yet. Who do I contact?"),u.default.createElement("dd",null,"Flight itineraries will be emailed to your preferred email that was provided during registration. All attendees will receive their flight itineraries by two weeks prior to departure. If you do not have your itinerary two weeks prior to your departure, please contact Business Support Services. If you need assistance, please contact Business Support Services at 1-800-527-8074 or 330-668-5000 ext. 8074 or email us at ",u.default.createElement("a",{href:"mailto:mlc@signetjewelers.com"},"mlc@signetjewelers.com"),"."),u.default.createElement("dt",null,"I have received my airline ticket for the conference. Can I use my miles to upgrade?"),u.default.createElement("dd",null,"No, any changes to your ticket could result in the cancellation of the entire group reservation."),u.default.createEl